import React from "react";
import Cards from "./Cards";

const CardSection = () => {
	return (
		<section className="contact bg-success ">
			<div className="container ">
				<h2 className="text-white">We love new friends!</h2>
				<div className="row">
					<div className="col-4">
						<Cards title="Malasiya" buttonText="Book a Trip"/>
					</div>
					<div className="col-4">
						<Cards title="SingaPore" buttonText="Book A Trip"/>
					</div>
					<div className="col-4">
						<Cards title="Thi"/>
					</div>
				</div>
			</div>
		</section>
	);
};

export default CardSection;
